script: |
  super -f text -I q6567.spq | sort > q6567.out

inputs:
  - name: q6567.spq
    data: |
      SELECT ALL + + 33 * col2 FROM tab2 (FORMAT parquet) WHERE NULL BETWEEN - - CAST ( col0 AS INTEGER ) + - + col1 + - col2 AND + - col1 - col1;
  - name: tab2

outputs:
  - name: q6567.out
    data: |
